import React from 'react';

import { Footer } from 'react-materialize';
import Grid from '@material-ui/core/Grid';
import logo from '../../assets/images/logo.svg';



const footer = (props) => (

    <Footer
    className="example"
    copyrights="Copyright Â© Dronaar 2020, All Rights Reserved"
    moreLinks={<a className="grey-text text-lighten-4 right" href="#!">More Links</a>}
  >
      <Grid container>
          
          <Grid item lg={12}><Grid container>
              <Grid item lg={4} className="footerGrid">logo</Grid>
              <Grid item lg={4} className="footerGrid"><ul><li><a className="grey-text text-lighten-3" href="#!">Link 1</a></li><li><a className="grey-text text-lighten-3" href="#!">Link 2</a></li><li><a className="grey-text text-lighten-3" href="#!">Link 3</a></li><li><a className="grey-text text-lighten-3" href="#!">Link 4</a></li></ul></Grid>
              <Grid item lg={4} className="footerGrid"><h5 className="white-text">
      Footer Content
    </h5></Grid>
          </Grid></Grid>
          
      </Grid>
    
    
  </Footer>
    
    );
    
    export default footer;
